import React from 'react';
import '../scss/index.scss'
 

const Navbar = () => {
    return (
        <div>
             <nav class="navbar navbar-light bg-black fixed-top">
                <div class="container-fluid">
                <a class="navbar-brand" href="#">Navbar</a>
                </div>
                
             </nav>
        </div>
    )
}

export default Navbar;
